import React from 'react'
import { discontinuousTimeScaleProvider } from "react-stockcharts/lib/scale";
import {
	CandlestickSeries,
} from "react-stockcharts/lib/series";
import { ChartCanvas, Chart } from "react-stockcharts";
import { XAxis, YAxis } from "react-stockcharts/lib/axes";
function graphh(props) {
    console.log(props.data.data.hcl)
    
    return (
        <div>
        {props.data.name}
        <ChartCanvas width={100} height={400}
        margin={{left: 50, right: 50, top:10, bottom: 30}} 
        seriesName="MSFT"
        
        xAccessor={props.data.data.hcl.opentime} xScaleProvider={discontinuousTimeScaleProvider}
        xExtents={[new Date(2012, 0, 1), new Date(2012, 6, 2)]}>

    <Chart id={1} yExtents={d => [props.data.data.hcl.High, props.data.data.hcl.Low]}>
        <XAxis axisAt="bottom" orient="bottom" ticks={6}/>
        <YAxis axisAt="left" orient="left" ticks={5} />
        <CandlestickSeries />
    </Chart>
</ChartCanvas>
        </div>
    )
}

export default graphh
